// src/admin/AdminProfile.js
import React, { useState } from 'react';
import './Adminpro.css';
import { useNavigate } from 'react-router-dom';

const AdminProfile = () => {
  const navigate = useNavigate();
  const [editing, setEditing] = useState(false);
  const [profileData, setProfileData] = useState({
    name: "Admin Name",
    email: "admin@example.com",
    phone: "(123) 456-7890",
    address: "1234 Street, City, Country",
    profilePicture: "../photos/profile.jpg"
  });

  const handleEditClick = () => {
    setEditing(!editing);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfileData({
      ...profileData,
      [name]: value,
    });
  };

  const handleSaveClick = () => {
    // Save profile data (you can implement saving logic here)
    setEditing(false);
  };

  return (
    <div className="admin-profile">
      <div className="navbar">
        <span className="brand" onClick={() => navigate('/admin-home')}>B.Planet</span>
        <div className="nav-links">
          <span className="nav-link" onClick={() => navigate('/contact-us')}>Contact Us</span>
          <span className="nav-link" onClick={() => navigate('/login')}>Login</span>
          <img src="../photos/profile.jpg" alt="Profile" className="profile-pic" onClick={() => navigate('/profile')} />
        </div>
      </div>
      <div className="profile-content">
        <h2>Profile</h2>
        <div className="profile-box">
          <div className="profile-left">
            <img src={profileData.profilePicture} alt="Profile" className="profile-picture" />
            {editing ? (
              <input type="file" name="profilePicture" onChange={handleChange} />
            ) : null}
          </div>
          <div className="profile-right">
            {editing ? (
              <div>
                <div className="form-field">
                  <label>Name:</label>
                  <input type="text" name="name" value={profileData.name} onChange={handleChange} />
                </div>
                <div className="form-field">
                  <label>Email:</label>
                  <input type="email" name="email" value={profileData.email} onChange={handleChange} />
                </div>
                <div className="form-field">
                  <label>Phone:</label>
                  <input type="text" name="phone" value={profileData.phone} onChange={handleChange} />
                </div>
                <div className="form-field">
                  <label>Address:</label>
                  <input type="text" name="address" value={profileData.address} onChange={handleChange} />
                </div>
                <button onClick={handleSaveClick}>Save</button>
              </div>
            ) : (
              <div>
                <p><strong>Name:</strong> {profileData.name}</p>
                <p><strong>Email:</strong> {profileData.email}</p>
                <p><strong>Phone:</strong> {profileData.phone}</p>
                <p><strong>Address:</strong> {profileData.address}</p>
                <button onClick={handleEditClick}>Edit Profile</button>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminProfile;
